import "./Home.scss"
import React from 'react'
import Navbar from "../components/navbar/Navbar";
import Feature from "../components/feature/Feature";


 const Home = () => {
  return (
    <div className='home'>
        <Navbar />
        <Feature type="series"/>
    </div>
  )
}

export default Home;
